-- include sfx 0 "m_tns_tetsudan_run_point_1_60.ogg"

RADIUS_INNER = 20
RADIUS_OUTER = 200
BASE_SPEED = 60
FADE_OUT = 0.001

local function clamp(x, a, b)
	return math.min(math.max(x, a), b)
end

local sfx_channel = {}
local channels_not_in_use, channels_in_use = {0, 1, 2, 3}, {}

local function stop_channel(channel)
	if component.sfxStop(channel) then
		for i, v in ipairs(channels_in_use) do
			if v == channel then
				table.remove(channels_in_use, i)
				table.insert(channels_not_in_use, channel)
				return true
			end
		end
	end
	return false
end

local function allocate_channel()
	if #channels_not_in_use == 0 then
		stop_channel(channels_in_use[1])
	end
	if #channels_not_in_use > 0 then
		local channel = table.remove(channels_not_in_use, 1)
		table.insert(channels_in_use, channel)
		return channel
	else
		return nil
	end
end

local function sfx_update(i, volume, pitch, is_once)
	if volume > 0 then
		if sfx_channel[i] == nil then
			local channel = allocate_channel()
			if channel ~= nil then
				local fn = is_once and component.sfxPlayOnce or component.sfxPlayLoop
				if fn(channel, i - 1, 0, 0, 0, RADIUS_INNER, RADIUS_OUTER, volume, pitch, 1) then
					sfx_channel[i] = channel
				end
			end
		else
			component.sfxUpdate(sfx_channel[i], 0, 0, 0, RADIUS_INNER, RADIUS_OUTER, volume, pitch)
		end
	elseif volume <= 0 and sfx_channel[i] ~= nil then
		if stop_channel(sfx_channel[i]) then
			sfx_channel[i] = nil
		end
	end
end

local function check_polygon(polygon, x, y)
	local n, f = #polygon, false
	for i = 1, n, 2 do
		local j = (i + 1) % n + 1
		local xi, yi, xj, yj = polygon[i], polygon[i + 1], polygon[j], polygon[j + 1]
		if (yi > y) ~= (yj > y) and x < xi + (y - yi) * (xj - xi) / (yj - yi) then
			f = not f
		end
	end
	return f
end

local function find_polygon(elements, x, y)
	for _, el in ipairs(elements) do
		local b = el.b
		if b[1] <= x and x <= b[3] and b[2] <= y and y <= b[4] then
			if el.p then
				if check_polygon(el.p, x - b[1], y - b[2]) then
					return true
				end
			elseif el.c then
				if find_polygon(el.c, x - b[1], y - b[2]) then
					return true
				end
			end
		end
	end
	return false
end

local volume = 0

function onTick()
	local play, speed = false, 0

	for i = 0, 1 do
		composite, success = component.getInputLogicSlotComposite(i)
		if success then
			local fv = composite.float_values
			if find_polygon(POLYGON_TREE, fv[1], fv[3]) then
				play = true
				speed = math.abs(fv[9])
				break
			end
		end
	end

    local pitch = 3.6 * speed / BASE_SPEED
	local volume_target = 0
	if play and pitch >= 0.1 then
        volume_target = 1
	end
    volume = clamp(volume_target, math.max(volume - FADE_OUT, 0), 1)
	sfx_update(1, volume, pitch, true)
end

function onRemoveFromSimulation()
	for i = 0, 3 do
		stop_channel(i)
	end
end
